    is used by many NYC Council district offices to enter and track constituent cases
    that can range from issues around affordable housing, to potholes and pedestrian
    safety. This dataset aggregates the information that individual staff have input.
    However, district staffs handle a wide range of complex issues. Each offices uses
    the program differently, and thus records cases, differently and so comparisons
    between accounts may be difficult. Not all offices use the program. For more info
